class LessonLibraryListComponent extends Component {
    constructor(props) {
        super(props);

        this.state = {
            userId: '',
            name: '',
            description: '',
            names: [],
            descriptions: []
        }

    }

    render() {
        return (
            <div>
                <h2 className="text-center">Список тем</h2>
                <div className="row">
                    <table className="table table-striped table-bordered">
                        <thead>
                            <tr>
                                <td>Описание</td>
                            </tr>
                        </thead>
                        <tbody>
                        </tbody>
                    </table>
                </div>
            </div>
        );
    }
}

export default LessonLibraryListComponent;
